function AppViewModel(){var n=this;n.SelectedUserId=ko.observable();n.UserList=ko.observableArray([]);n.ProjectList=ko.observableArray([]);n.SelectedUserId.subscribe(function(t){$.ajax({url:"/api/project/userid?"+t.id(),type:"GET",datatype:"json",success:function(t){var i=$.map(t,function(n){return new ProjectViewModel(n)});n.ProjectList(i)},error:function(n){alert(n)}})});n.GetUsers=function(){$.ajax({type:"GET",dataType:"json",url:"/api/user",success:function(t){var i=$.map(t,function(n){return new UserViewModel(n)});n.UserList(i)},error:function(){}})};n.GetUsers()}function UserViewModel(n){var t=this;t.id=ko.observable(n.id);t.userName=ko.observable(n.firstName+" "+n.lastName)}function ProjectViewModel(n){var t=this;t.projectid=ko.observable(n.projectid)}$(document).ready(function(){ko.applyBindings(new AppViewModel)});